import "./App.css";

function Hello({ props }) {
  return (
    <div>
      <p>Hello {props.name}!</p>
    </div>
  );
}

function App() {
  const now = Date();
  const a = 10;
  const b = 20;

  console.log(now, a + b);
  return (
    <div>
      <h1>Greetings!</h1>
      <Hello /> <p>it is {now.toString()}</p>
      <p>
        {a} plus {b} is {a + b}
      </p>
    </div>
  );
}

export default App;
